import React, { Component } from "react";

interface User {
  name: string;
  id: number;
}

class UserAccount extends Component<User>{
  constructor(name: string, id: number) {
    super();
    this.name = name;
    this.id = id;
  }
}

export const viewType:User = new UserAccount("Stepheny", 1);

function TypeScriptForJsProgrammers() {
  const user: User = {
    name: "Divine",
    id: 0,
  };

  return <div>{`${user.name}and ${user.id}`}</div>;
}

